instance.peoplecode_text:
/**
* Gets/Sets Student Cohort data into/from a staging table
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_StudentCohort
   method CCTC_StudentCohort();

   method getList(&bindVars As array of any) Returns array of array of any;

   method getCohort(&bindVars As array of any) Returns array of array of any;

   method setCohort(&bindVars As array of any) Returns array of array of any;

   method removeCohort(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_StudentCohort
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve a list of the cohorts assigned to a student for a term
* from a staging table
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: California Community College id of the student
* &bindVars[2]: sisTermId: STRM
* @Returns all matching rows (if any), empty array if not found
*/
method getList
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 2 Then
      Error "bindVars should have 2 elements when listing cohorts";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_COHORT_STG_LST, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 30;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve a list of the cohorts assigned to a student for a term
* from a staging table
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: California Community College id of the student
* &bindVars[2]: sisTermId: STRM
* &bindVars[3]: Cohort Code
* @Returns all matching rows (if any), empty array if not found
*/
method getCohort
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when getting cohorts";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "cohort code is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_COHORT_STG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 30;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* insert Student Cohort data into a staging table
* 
* @param &bindVars array of data to insert into the staging table
* &bindVars[1]: California Community College id of the student
* &bindVars[2]: sisTermId: STRM
* &bindVars[3]: Cohort Code
* @Returns 2d array with rows affected in first row, first column
*/
method setCohort
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when adding a cohort";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "Term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "Cohort Code is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_COHORT_STG_SET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));
end-method;

/**
* This function provides an interface to the College Adaptor to 
* remove Student Cohort data from a staging table
* 
* @param &bindVars array of keys to remove from the staging table
* &bindVars[1]: California Community College id of the student
* &bindVars[2]: sisTermId: STRM
* &bindVars[3]: Cohort Code
* @Returns 2d array with rows affected in first row, first column
*/
method removeCohort
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when removing cohort";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "Cohort Code is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_COHORT_STG_RMV, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error "SQL Status not ok [" | String(&sql.Status) | "]";
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;
